import React from "react";
import Person from "./Person";

function NameList() {
  const names = ["sravan", "kumar", "kittu"];
  const persons = [
    {
      id: 1,
      name: "sravan",
      age: 24,
      skill: "react",
    },
    {
      id: 2,
      name: "krishna",
      age: 24,
      skill: "angular",
    },
    {
      id: 3,
      name: "kumar",
      age: 24,
      skill: "native",
    },
    {
      id: 4,
      name: "reddy",
      age: 24,
      skill: "node",
    },
  ];
  const nameList = persons.map((person) => (
    <Person key={person.id} person={person} />
  ));
  return <div>{personList}</div>;
}

export default NameList;
